      function F_PARTY_NAMEFormatTrigger return boolean is
begin

  -- Automatically Generated from Oracle Reports Builder.
  if (:PARTY_NAME = 'Sub Total')
  then
    srw.set_font_face('Tahoma');
    srw.set_font_size(10);
    srw.set_font_weight(srw.bold_weight);
    srw.set_font_style(srw.plain_style);
  end if;

  return (TRUE);
end;

